import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.css";

class Table extends React.Component{
 data = [
   this.props.h,
   this.props.r
 ];
 render(){
   return(
       <table>
         <tbody>
           {
                this.data.map((numList,i) =>(
                   <tr key={i}>
                    {
                      numList.map((num,j)=>
                         <td key={j}>{num}</td>
                      )
                    }
                   </tr>
                ))
           }
         </tbody>
       </table>
   );
 }
}

export default Table;
